// task 3

const sayim = document.querySelector(".sayim");

function geriSayim(saniye) {
  let stopSay = setInterval(() => {
    sayim.textContent = saniye;

    if (saniye == 0) {
      sayim.textContent = "finis";
      clearInterval(stopSay);
    }
    saniye -= 1;
  }, 1000);
}

geriSayim(5);

